const Rules_Overview = () => {
  return (
    <section className="text-center pgacenter">
      <p className="label">
        پیش از هر گونه استفاده از وبسایت حتما تمام منشور (قوانین) را به دقت
        بخوانید. از توجه شما سپاسگزاریم.
      </p>
    </section>
  );
};

export default Rules_Overview;
